import Link from 'next/link';

const Header = () => (
  <Flex
    px={2}
    color='white'
    bg='black'
    alignItems='center'>
    <Text p={2} fontWeight='bold'>Rebass</Text>
    <Box mx='auto' />
    <Link href="/" variant='nav' href='#!'>
      Home
  </Link>
    <Link href="/about" variant='nav' href='#!'>
      About
  </Link>
  </Flex>
);

export default Header;
